import Data from './Data'

  const Cont = () => {

    const conts = [
        {
        'num' : "1:",
         sml : "yes",
         nam : "Presbo",
         email : 'presbo@columbia.edu'
        },

        { 
        'id': "3",
        'small': 'no', 
        'nam': "John Doe",
        'email' : 'flipper@columbia.com' 
        },


      ];

      return (
        <>
          {conts.map((cont) => (
             <Data num = {cont.id} sml = {cont.sml} nam = {cont.nam} email = {cont.email}/>
          ))}
        </>
      );
    };

  export default Cont
